import React from "react"
import { Tabs, Tab } from "react-mdl"

class Projects extends React.Component {
    constructor() {
        super()

        this.state = {
            activeTab: 0
        }
    }

    render() {
        return (
            <div className="catagory-tabs">
                <Tabs activeTab={this.state.activeTab} onChange={tabId => {activeTab: tabId}} ripple>
                    <Tab>Flask</Tab>
                    <Tab>Rails</Tab>
                    <Tab>React</Tab>
                </Tabs>
            </div>
        )
    }
}
 
export default Projects
